-- ----------------------------
-- Procedure structure for IMPORTAR_PERSONAL
-- ----------------------------
DROP PROCEDURE IF EXISTS `IMPORTAR_PERSONAL`;
DELIMITER ;;
CREATE DEFINER=`adif`@`%` PROCEDURE `IMPORTAR_PERSONAL`()
BEGIN
	DECLARE done INT DEFAULT 0;
  
	DECLARE p_persona_nombre, p_persona_apellido, p_persona_dni, p_persona_cuil, p_persona_sexo, p_persona_telefono, 
					p_persona_celular, p_persona_email, p_domicilio_calle, p_domicilio_numero, p_domicilio_depto, 
					p_domicilio_piso, p_domicilio_cp, p_cuenta_cbu, p_estudio_titulo 
					VARCHAR(255);

	DECLARE p_persona_fecha_nacimiento, p_empleado_fecha_ingreso, p_empleado_fecha_inicio_ant 
					DATETIME;

	DECLARE p_persona_id_estado_civil, p_persona_id_nacionalidad, p_domicilio_id, p_domicilio_id_localidad, 
					p_persona_id, p_empleado_nro_legajo, p_empleado_id_subcategoria, p_empleado_id_gerencia, p_empleado_id_subgerencia,
					p_empleado_id_area, p_empleado_id_sector, p_cuenta_id, p_cuenta_banco_id, p_tipo_contrato_id,
					p_id_nivel_estudio, p_empleado_id
					integer;
  
	DECLARE cur CURSOR FOR 
		SELECT 	persona_nombre, persona_apellido, persona_dni, persona_cuil, persona_sexo, 
						fecha_nacimiento, id_estado_civil, TEL, CEL, id_nacionalidad,
						id_localidad, persona_domicilio_calle, persona_domicilio_numero, persona_domicilio_depto, persona_domicilio_piso, CP,
						fecha_ingreso, fecha_inicio_antiguedad, `Nº LEG`, id_subcategoria, 
						id_gerencia, id_subgerencia, id_area, id_sector,
						id_banco, cuenta_cbu, id_tipo_contrato, id_nivel_estudio, TITULO
		FROM importacion_personal;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

	

  OPEN cur;
  
  el_loop: LOOP
    FETCH cur 
		INTO  p_persona_nombre, p_persona_apellido, p_persona_dni, p_persona_cuil, p_persona_sexo, 
				  p_persona_fecha_nacimiento, p_persona_id_estado_civil, p_persona_telefono, p_persona_celular, p_persona_id_nacionalidad,
				  p_domicilio_id_localidad, p_domicilio_calle, p_domicilio_numero, p_domicilio_depto, p_domicilio_piso, p_domicilio_cp,
				  p_empleado_fecha_ingreso, p_empleado_fecha_inicio_ant, p_empleado_nro_legajo, p_empleado_id_subcategoria, 
					p_empleado_id_gerencia, p_empleado_id_subgerencia, p_empleado_id_area, p_empleado_id_sector,
					p_cuenta_banco_id, p_cuenta_cbu, p_tipo_contrato_id, p_id_nivel_estudio, p_estudio_titulo
		;

		IF (done = 1) THEN
			LEAVE el_loop;
		END IF;
    
		/* DOMICILIO */
		VALUES (p_domicilio_id_localidad, p_domicilio_calle, p_domicilio_numero, p_domicilio_piso, p_domicilio_depto, p_domicilio_cp);
		SET p_domicilio_id = LAST_INSERT_ID();
		
		/* PERSONA */
			apellido, 
			nombre,
			sexo,
			id_tipo_documento,
			nro_documento,
			cuil, 
			fecha_nacimiento,
			id_estado_civil,
			id_domicilio,
			telefono,
			celular,
			email,
			id_nacionalidad
		) VALUES (
			p_persona_apellido,
			p_persona_nombre, 
			p_persona_sexo, 
			1, 
			p_persona_dni,
			p_persona_cuil,
			p_persona_fecha_nacimiento,
			p_persona_id_estado_civil, 
			p_domicilio_id, 
			p_persona_telefono, 
			p_persona_celular,
			NULL, 
			p_persona_id_nacionalidad
		);
		SET p_persona_id = LAST_INSERT_ID();

		/* CUENTA */
		IF (p_cuenta_banco_id IS NOT NULL) THEN
			SET p_cuenta_id = LAST_INSERT_ID();
		ELSE
			SET p_cuenta_id = NULL;
		END IF;

		/* EMPLEADO */
			fecha_ingreso, nro_legajo, fecha_inicio_antiguedad, id_subcategoria, id_gerencia, 
			id_subgerencia, id_area, id_sector, id_cuenta, id_persona, id_tipo_contrato) 
		VALUES (p_empleado_fecha_ingreso, p_empleado_nro_legajo, p_empleado_fecha_inicio_ant, 
						p_empleado_id_subcategoria, p_empleado_id_gerencia, p_empleado_id_subgerencia,
						p_empleado_id_area, p_empleado_id_sector, p_cuenta_id, p_persona_id, p_tipo_contrato_id);
		SET p_empleado_id = LAST_INSERT_ID();

		/* ESTUDIO EMPLEADO */
		IF (p_id_nivel_estudio IS NOT NULL) THEN
				id_empleado, titulo, id_nivel_estudio, establecimiento, fecha_desde, fecha_hasta) 
			VALUES (p_empleado_id, p_estudio_titulo, p_id_nivel_estudio, '--', NULL, NULL);
		END IF;

	END LOOP el_loop;
  CLOSE cur;

	
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for IMPORTAR_PERSONAL_FAMILIARES
-- ----------------------------
DROP PROCEDURE IF EXISTS `IMPORTAR_PERSONAL_FAMILIARES`;
DELIMITER ;;
CREATE DEFINER=`adif`@`%` PROCEDURE `IMPORTAR_PERSONAL_FAMILIARES`()
BEGIN
	DECLARE done INT DEFAULT 0;
  
	DECLARE p_persona_nombre, p_persona_apellido, p_persona_dni, p_persona_cuil, p_persona_sexo VARCHAR(255);

	DECLARE p_persona_fecha_nacimiento DATETIME;

	DECLARE p_persona_id, p_id_empleado, p_id_tipo_relacion integer;
  
	DECLARE cur CURSOR FOR 
		SELECT cuil, apellido, nombre, dni, id_tipo_relacion, fecha_nacimiento, sexo
		FROM importacion_personal_familiares;
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;	

  OPEN cur;
  
  el_loop: LOOP
    FETCH cur 
		INTO  p_persona_cuil, p_persona_apellido, p_persona_nombre, p_persona_dni, p_id_tipo_relacion, 
			p_persona_fecha_nacimiento, p_persona_sexo
		;

		IF (done = 1) THEN
			LEAVE el_loop;
		END IF;
    
		/* PERSONA */
			apellido, 
			nombre,
			sexo,
			id_tipo_documento,
			nro_documento,
			fecha_nacimiento
		) VALUES (
			p_persona_apellido,
			p_persona_nombre, 
			p_persona_sexo, 
			1, 
			p_persona_dni,
			p_persona_fecha_nacimiento
		);
		SET p_persona_id = LAST_INSERT_ID();

		SELECT p_persona_id, e.id, p_id_tipo_relacion
		FROM persona p
			INNER JOIN empleado e ON p.id = e.id_persona
		WHERE cuil = p_persona_cuil;

	END LOOP el_loop;
  CLOSE cur;

	
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for split_string
-- ----------------------------
DROP PROCEDURE IF EXISTS `split_string`;
DELIMITER ;;
CREATE DEFINER=`adif`@`%` PROCEDURE `split_string`()
BEGIN

DECLARE my_delimiter CHAR(1);
DECLARE split_string varchar(255);
DECLARE done INT;
DECLARE occurance INT;
DECLARE i INT;
DECLARE split_id int;
DECLARE ins_query VARCHAR(500);
DECLARE splitter_cur CURSOR FOR
SELECT id_empleado,codigos from importacion_conceptos_empleados;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET done=1;

DROP TABLE IF EXISTS `my_splits`;
CREATE TABLE `my_splits` (
	`splitted_column` varchar(45) NOT NULL,
	`id` int(10) default NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

OPEN splitter_cur;
splitter_loop:LOOP
	FETCH splitter_cur INTO split_id,split_string;

	SET my_delimiter=',';
	SET occurance=length(split_string)-length(replace(split_string,my_delimiter,''))+1;
	IF done=1 THEN
		LEAVE splitter_loop;
	END IF;
	#  select occurance;
	IF occurance > 0 then
		#select occurance;
		set i=1;
		while i <= occurance do
			#        select concat(“SUBSTRING_INDEX(SUBSTRING_INDEX( ‘”,split_string ,”‘, ‘”,my_delimiter,”‘, “,i, “),’”,my_delimiter,”‘,-1);”);
			SET ins_query=concat("insert into my_splits(splitted_column,id) values(", concat("SUBSTRING_INDEX(SUBSTRING_INDEX( '",split_string ,"', '",my_delimiter,"', ",i, "),'",my_delimiter,"',-1),",split_id,");"));
			
			#    select ins_query;
			set @ins_query=ins_query;
			PREPARE ins_query from @ins_query;
			EXECUTE ins_query;
			set i=i+1;
		end while;
	ELSE
		set ins_query=concat("insert into my_splits(splitted_column,id) values(",split_string,"',",split_id,");");
		set @ins_query=ins_query;
		PREPARE ins_query from @ins_query;
		EXECUTE ins_query;
	END IF;

set occurance=0;
END LOOP;

CLOSE splitter_cur;

END
;;
DELIMITER ;
